import React from "react";
import Tetris from "./react-tetris/src/components/tetris/tetris";

const Games = () => {
  return (
    <div>
      <Tetris
        settings={{
          blockSize: 5,
          offset: 5,
          rows: 10,
          columns: 10,
          blockBorderWidth: 14,
          boardColor: "white",
          blockBorderRadius: "0%",
          intervalTimeInMiliSeconds: 1000,
          blockOutline: 3,
          animation: false,
          boardBorderColor: "#e6e6e6",
          buttonsBackgroundColor: "white",
          buttonsColor: "black",
        }}
      />
    </div>
  );
};

export default Games;
